import React from 'react'

import { cardData } from '../../cardData'

export const Box = () => {
  console.log('cardData', cardData)
  cardData.map((card, index) => {
    return (
      <div key={index}>
          <p>Buy {card.amount}</p>
          <p></p>
      </div>
    )
})}
